import React from 'react';
import Logo from "../../assets/images/logo.png";

import { Container } from './styles'


const Home: React.FC = () => {


  return (
    <>
      <Container>
        <img src={Logo} alt="DcComics" style={{ height: 200, width: 200 }} />

      </Container>
    </>
  );
};

export default Home;
